[v1.02] added special handling for updating 'content-type' header

applies patch made to [moz-rewrite](https://github.com/warren-bank/moz-rewrite) in commit [7ea64de](https://github.com/warren-bank/moz-rewrite/commit/7ea64debc9883d355aeca311da603ca5ef0ee996)

noticed while testing the following rule in the response data set:

``` json
[
{
    "url": "\\.(json|jsonp)$",
    "headers": {
        "content-type" : "application/json"
    }
},
{
    "url": "[\\?&]callback=",
    "headers": {
        "content-type" : "application/json"
    }
}
]
```

..that an Exception was being logged.
- turns out that the API treats this header differently
- rather than calling the normal `setResponseHeader` method,<br>
  a special read/write attribute `contentType` needs to be changed

now, the above rule works beautifully.

[v2.01] added special handling for updating _'content-type'_ header

noticed while testing the following rule in the response data set:

``` javascript
[
{
    "url": /^.*$/,
    "headers": function(){
        // normalize media types using the new "+json" suffix
        // details:
        //   * https://tools.ietf.org/html/rfc6839#section-3.1
        // examples:
        //   * http://www.w3.org/TR/json-ld/#application-ld-json
        //     http://json-ld.org/contexts/person.jsonld

        var $headers = {};
        var pattern = /\+json$/i;
        if (pattern.test(response.content_type)){
            $headers['content-type'] = 'application/json';
            $headers['content-disposition'] = null;
            response.content_type = $headers['content-type'];
        }
        return $headers;
    }
}
]
```

..that an Exception was being logged.
- turns out that the API treats this header differently
- rather than calling the normal `setResponseHeader` method,<br>
  a special read/write `contentType` attribute needs to be changed

now, the above rule works beautifully.

..especially when displayed using [JSON-DataView](https://github.com/warren-bank/moz-json-data-view)
..just saying :grinning:

[v1.09] support jsonp response format used by ExpressJS

https://github.com/strongloop/express/blob/master/lib/response.js

https://github.com/strongloop/express/commits/master/lib/response.js
strongloop/express@e218377
strongloop/express@f684a64
- jsonp response format (legacy):
      cb && cb(json);
- jsonp response format (after commit #e218377, Oct/15/2013):
      typeof cb === 'function' && cb(json);
- jsonp response format (after commit #f684a64, Jul/10/2014):
      /**/ typeof cb === 'function' && cb(json);

